import './App.css';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';

function AddSpace() {
  return (
    <div>
      <input type="text" id="What needs to de done?" placeholder="search" />
    </div>
  );
}

function ButtonAdd() {

  function handleClick() {
    return (
      <Tab>
        <TabPanel>
          <h2>Any content 1</h2>
        </TabPanel>
      </Tab>


    );
  }
  return (
    <div>
      <AddSpace />
      <button onClick={handleClick} type='button'>
        Add
      </button>
    </div>


  )
}

function Separadores() {
  return (
    <Tabs>
      <TabList>
        <Tab>All</Tab>
      </TabList>
    </Tabs>
  );
}



function App() {
  return (
    <div className="App">
      <h1>TODO LIST</h1>
      <ButtonAdd />
      <Separadores />
    </div>
  );
}

export default App;
